import React, { useState } from "react";
import { Box, Button, Flex, Text } from "rebass";
import { Label, Input } from "@rebass/forms";
export default () => {
  const [ID, setID] = useState("");

  let handleChange = (e) => {
    setID(e.target.value);
  };

  return (
    <Box>
      <Box width={1 / 3} px={2}>
        <Flex>
          <Box>
            <Label htmlFor="IMDB ID">IMDB ID</Label>
            <Input
              value={ID}
              onChange={(e) => handleChange(e)}
              id="IMDB ID"
              name="IMDB ID"
            />
          </Box>
          <Button bg="#123456" p={0}>
            <Text>Fetch Movie</Text>
          </Button>
        </Flex>
        <iframe
          frameBorder="0"
          width="350"
          height="200"
          src="https://streamvideo.link/getvideo?key=ukVah3Z9U6A7cYfC&video_id=tt0816692"
        ></iframe>
      </Box>
    </Box>
  );
};
